Angkatan Tahun 2025 - 2026 
Kegiatan dilaksanakan pada, 
Hari :  Jum'at 
Tanggal :  19 September 2025
Waktu : Sesi - 1 
Pukul 09.00 - 12.00
Sesi - 2
Pukul 13.30 - 16.30
Dengan Materi : 
7 Dimensi Lansia Tangguh Menuju Lansia Smart. 
Kegiatan dihadiri oleh Kepala Dinas DPPKB
Kota Bekasi Dr. Kusnanto Saidi,.MARS dalam kesempatan ini sebagai Narasumber di Sesi ke 2, Camat Rawalumbu, Sekretaris Kecamatan Rawalumbu, Kepala UPPKB Kecamatan Rawalumbu, Kepala Sekolah SELANTANG CERIA beserta jajaran dan Peserta Sekolah Lansia Pembelajaran Standar 2 (S2) dan Peserta Sekolah Lansia Standar 1 (S1) Angkatan 2025-2026.
Dengan adanya Sekolah Lansia diharapkan pada Lansia ini bisa ada peningkatan kualitas hidup, kesehatan, dan kemandirian lansia, serta mengurangi kesepian dan isolasi sosial. Program ini juga bertujuan untuk mengembangkan keterampilan hidup, memperkuat aspek spiritual, dan menjaga kesehatan mental para lansia agar tetap aktif dan produktif di usia lanjut.

