Ibu Wali Kota Bekasi @wiwiekhargono didampingi Ibu Wakil Walikota Bekasi ibu Wuri Handayani meresmikan Program Rumah Tidak Layak Huni (Rutilahu) di Kp. Rawa Roko RT 04 RW 05 Kelurahan Bojong Rawalumbu Kecamatan Rawalumbu. Program ini merupakan bentuk kolaborasi antara Pemerintah Kota Bekasi dengan Yayasan Bersinar Pelita Hati dan RS. HERMINA Bekasi sebagai upaya bersama dalam meningkatkan kesejahteraan masyarakat melalui perbaikan rumah tinggal yang tidak layak huni. 

Turut hadir dalam kegiataan ini Drs. Sudarsono selaku pembina Yayasan Bersinar Pelita Hati, Camat Rawalumbu, Sekretaris Kecamatan Rawalumbu, Plt. Lurah Bojong Rawalumbu, perwakilan Rs. Hermina Bekasi, Ketua Tp. PKK Kecamatan Rawalumbu, Babinsa Kelurahan Bojong Rawalumbu, Bhabinsa Kelurahan Bojong Rawalumbu, Ketua TP. PKK Kelurahan seKecamatan Rawalumbu, BKM Kelurahana Bojong Rawalumbu, LPM Kelurahan Bojong Rawalumbu, Ketua RW 025 Kelurahan Bojong Rawalumbu, Ketua RT seRW 02 Kelurahan Bojong Rawalumbu dan ibu² Kader Posyadu RW 025 Kelurahan Bojong Rawalumbu.

Peresmian Rutilahu ditandai dengan pemotongan pita dan pemberian bantuan sembako kepada Penerima Manfaat ibu Nengsih. Penyerahan langsung diberikan Ibu Walikota Bekasi didampingi Ibu Wakil Walikota Bekasi 

Pada kegiatan ini, Ibu Nengsih sebagai penerima manfaat Program Rutilahu menyampaikan rasa terima kasih atas bantuan yang diterimanya. Kehadiran program ini diharapkan mampu memberikan dampak nyata dalam meningkatkan kualitas hunian serta kesejahteraan warga di Kelurahan Bojong Rawalumbu dan wilayah lainnya di Kota Bekasi.

Dengana adanya Kegiatan ini Pemerintah Kota Bekasi akan terus mendorong kolaborasi dengan berbagai pihak untuk memperluas jangkauan program perbaikan rumah tidak layak huni agar semakin banyak masyarakat yang dapat merasakan manfaatnya demi kesejahteraan bersama.

