Peserta berasal dari perwakilan 12 Kecamatan seKota Bekasi dengan mengirimkan 2 perwakilannya. 
Tahun 2025 Kecamatan Rawalumbu mengirimkan 2 perwakilannya yaitu :
1. Ibu Apriliawati dari Kelurahan Bojong Rawalumbu yang merupakan perempuan inspiratif dibidang Sosial Budaya
2. Ibu Siti Hamidah dari Kelurahana Pengasinana yang merupakan perempuan inspiratif di bidang pendidikan
Lomba Perempuan Inspiratif adalah ajang untuk mengapresiasi dan merayakan peran serta pencapaian perempuan dalam berbagai bidang. Lomba ini bertujuan untuk menginspirasi orang lain melalui kisah-kisah perempuan yang memiliki dampak positif bagi masyarakat.
Diakhir acara pengumuman pemenang yang dibacakan langsung oleh Kepala DP3A Kota Bekasi ibu drh. Satia Sriwijayanti Anggraini, M.M didampingi Tim juri.
Untuk Lomba Tahun 2025 ini Perwakilan Kecamatan Rawalumbu Ibu Aprilia memperoleh Juara II Lomba Perempuan Inspiratif Tingkat Kota Bekasi Tahun 2025.
Selamat kepada pemenang, trus bersemangat menginspirari perempuan-perempuan di Kota Bekasi.

